import './Content.css';
import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Campaigns from '../Campaigns/Campaigns.component';
import Criteria from '../Criteria/Criteria.component';

const Content = () => {
  return (
    <Router>
      <div className="content-div">
        <div className="content-div-box">
          <Switch>
            <Route exact path="/">
              <Home />
            </Route>
            <Route path="/campaigns">
              <Campaigns />
            </Route>
            <Route path="/criteria">
              <Criteria />
            </Route>
            <Route path="/settings">
              <Settings />
            </Route>
            <Route path="/notifications">
              <Notifications />
            </Route>
            <Route path="/profile">
              <Profile />
            </Route>
          </Switch>
        </div>
      </div>
    </Router>
  );

}

function Home() {
  return (
    <div>
      <h2>Home</h2>
    </div>
  );
}

function Settings() {
  return (
    <div>
      <h2>Settings</h2>
    </div>
  );
}

function Notifications() {
  return (
    <div>
      <h2>Notifications</h2>
    </div>
  );
}

function Profile() {
  return (
    <div>
      <h2>Profile</h2>
    </div>
  );
}

export default Content;
